import React from "react";

import Card from "../UI/Card";

import styles from "./Piece.module.css";

function Piece(props) {
  return (
    <Card>
      {props.title}
      {props.author}
      {props.id}
      {props.type}
    </Card>
  );
}

export default Piece;
